import React, {Component} from "react";

export default class Pilots extends Component {
    render() {
        let data = this.props.data;
        let species = 'Unknown';
        if (data[0].species.length !== 0) {
            species = data[0].species[0].name;
        }
        data[0].species.map((pilot) => {
            console.log(pilot);
        });
        return (
            <span>{data[0].name} - {species}</span>
        );
    }
}
